import React, { useEffect } from 'react';
import './App.css';
import userImage from './user-image.png';
import whiteArrow from './arrow-white.png';
import yellowArrow from './arrow-yellow.png';
import lightTealArrow from './arrow-lightteel.png';
import skyBlueArrow from './arrow-skyblue.png';
import animation1 from './animation1-background.png';


function App() {

  useEffect(() => {
    const handleScroll = () => {
      const navbar = document.querySelector('.Navbar');
      const logoContainer = document.querySelector('.logo-container');
      const logoContainerBottom = logoContainer.offsetTop + logoContainer.offsetHeight;
      if (window.pageYOffset >= logoContainerBottom) {
        navbar.classList.add('fixed-navbar');
      } else {
        navbar.classList.remove('fixed-navbar');
      }
    };
    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  window.onload = function() {
    setTimeout(function() {
      window.scrollTo(0, 0);
    }, 0);
  }

  return (
    <div className="App">
      <header className="App-header">
      <div className="logo-container"></div>
        <nav className="Navbar">
          <div className="leftNav">
            <a href="#features">Features</a>
            <a href="#pricing">Pricing</a>
            <a href="#discover">Discover</a>
          </div>
          <a href="#login" className="login">Login</a>
          <a href="#joinWaitlist" className="joinWaitlist">Join Waitlist</a>
        </nav>
      </header>
      <main className="main-content">
        <div className="left-column">
          <div className="arrows-animation">
            <img src={skyBlueArrow} alt="Sky Blue Arrow" className="arrow skyBlue" />
            <img src={lightTealArrow} alt="Light Teal Arrow" className="arrow lightTeal" />
            <img src={yellowArrow} alt="Yellow Arrow" className="arrow yellow" />
            <img src={whiteArrow} alt="White Arrow" className="arrow white" />
          </div>
          <div className="animation-background">
            <img src={animation1} alt="background" />
          </div>
        </div>
        <div className="right-column">
          <h1>Image to Code in Seconds</h1>
          <p>Transform your images into executable code with just a few clicks. Experience the magic of automation.</p>
          <button>Try Now</button>
        </div>
      </main>
      <section className="new-section">
        <h1>You know all those great images you have? We want you to see all the extraordinary things you could do with its code.</h1>
        <div className="media-container">
          <img src={userImage} alt="User's creation" />
          <video controls autoPlay loop muted>
            <source src="/code-in-text.mp4" type="video/mp4" />
            Your browser does not support the video tag.
          </video>
        </div>
      </section>
      <section className="waitlist-section">
        <h2>Join the waitlist if you would like to use SnapCode and get the latest news!</h2>
        <div className="waitlist-form">
          <input type="email" placeholder="Your Email Address" />
          <button type="submit"><span>Submit</span></button>
        </div>
      </section>
    </div>
  );
}

export default App;
